function Start(start) {
    console.log(start);



return (
    <div className="rating">
   {"start : 1" == start ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {"start : 2" == start ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {"{start : 3}" == start ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}
   {'"start" : 4' == start ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked />}
   { console.log('aca' + JSON.stringify(start).valueOf())}
   {"start : 5" == start ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" />}

    </div>
  )
}
export default Start
